def astype_nansafe(arr, dtype, copy: bool = True, skipna: bool = False):
    """
    Cast the elements of an array to a given dtype in a nan-safe manner.

    Parameters
    ----------
    arr : ndarray
    dtype : np.dtype
    copy : bool, default True
        If False, a view will be attempted but may fail, if
        e.g. the item sizes don't align.
    skipna: bool, default False
        Whether or not we should skip NaN when casting as a string-type.

    Raises
    ------
    ValueError
        The dtype was a datetime64/timedelta64 dtype, but it had no unit.
    """

    if is_extension_array_dtype(dtype):
        return dtype.construct_array_type()._from_sequence(arr, dtype=dtype, copy=copy)

    if not isinstance(dtype, np.dtype):
        dtype = pandas_dtype(dtype)

    if issubclass(dtype.type, str):
        return lib.astype_str(arr.ravel(), skipna=skipna).reshape(arr.shape)

    # Handle datetime and timedelta dtype
    if is_datetime64_dtype(arr):
        if is_object_dtype(dtype):
            return tslib.ints_to_pydatetime(arr.view(np.int64))
        elif dtype == np.int64:
            return arr.view(dtype)
        else:
            return arr.view(dtype)

    elif is_timedelta64_dtype(arr):
        if is_object_dtype(dtype):
            return tslibs.ints_to_pytimedelta(arr.view(np.int64))
        elif dtype == np.int64:
            return arr.view(dtype)
        else:
            return arr.view(dtype)

    # Handle casting from floating to integer type
    elif np.issubdtype(arr.dtype, np.floating) and np.issubdtype(dtype, np.integer):
        mask = np.isnan(arr)
        if mask.any():
            arr = arr.astype(object)
            arr[mask] = np.nan
            return arr.astype(dtype)
        else:
            return arr.astype(dtype)

    # Handle casting from object types to datetime or timedelta
    elif is_object_dtype(arr):
        if is_datetime64_dtype(dtype):
            return to_datetime(arr).astype(dtype)
        elif is_timedelta64_dtype(dtype):
            return to_timedelta(arr).astype(dtype)

    # If none of the above conditions are met, perform the cast
    return arr.astype(dtype, copy=copy)
